        <div>
            <Container>
                <Row className='g-5'>
                    <Col className='bg-dark text-light border' lg={4} md={6} sm={8}>sm=true</Col>
                    <Col className='bg-dark text-light border' lg={4} md={6} sm={12}>sm=true</Col>
                    <Col className='bg-dark text-light border' lg={4} md={6} sm={12}>sm=true</Col>
                </Row>
            </Container>
        </div>
    );
};

export default Footer;
